import React, {Component } from "react";

class table extends Component {
  render() {
    return (
      <div class="table">

        <ul>
          <li>id</li>
          <li>Nom</li>
          <li>prenom</li>
          <li>action</li>
          <li>supr</li>
        </ul>
      </div>
    );
  }
}
export default table;
